■お買い物の前にご確認ください ⇒ 在庫表示/配送/送料等のご説明<br><br><table width="100%"  cellspacing="0" cellpadding="10" border="1" bordercolor="#848484"><tr><th align="center" style="color:#000000; background:#DDDDDD;" width="40%"><font size="2">商品情報</font></th><td><font size="2">ダイワ グローブライド プロバイザー HD DAIWA PROVISOR <br /><br />座れて便利！開閉簡単！信頼のダイワ高機能クーラーボックス <br /> <br />防波堤・船・磯・サーフなど、つりのジャンルを問わず活躍する信頼のダイワクーラーボックス。座っても大丈夫な「マッスルボディ」、開け閉めしやすい「リフトアップオープンシステム」、持ち運びや車への出し入れ時に便利なロングハンドル、水抜きに便利な水栓など、使いやすい機能を満載。保冷力に優れた真空パネルから軽さがメリットのスチロールまで、用途とシーンに合わせて選べる豊富なバリエーションで、釣りはもちろん確かな保冷力が必要なアウトドアシーンなどでも重宝する。 <br /><br /><br />●座っても大丈夫な「マッスルボディ」。<br />●上フタ天面のレバーに指を掛ける構造で開け閉めしやすい「リフトアップオープンシステム」<br />●使い勝手のよい両開きタイプのフタ。<br />●全アイテムにダイワクーラー専用の滑り止めラバー「ふんばるマン」付き。<br />●クーラー本体に練り込んだ消臭剤が生魚臭成分を反応させ、持続性が高い化学的消臭機能付き。（※ZSSのみ）<br />●取り外し取り付けが簡単な肩ベルト付き（※ZSS、SUのみ）<br />●底面滑り止めシート付き（※ZSS 2700のみ）<br /><br />■発売年：2016年</font></td></tr></table><STYLE type="text/css">
